import Link from 'next/link';
const Home = () => (
	<div>
		<ul>
			<li><Link href="/login"><a>Login</a></Link></li>
			<li><Link href="/signup"><a>Signup</a></Link></li>
		</ul>
		<h5>Welcome to weather app</h5>
		<style jsx>{`
			ul {
				background: #333;
				text-decoration: none;
			}
			ul li {
				font-size: 18px;
			}
			ul li a {
				color: white;
			}
		`}
		</style>
	</div>
)

export default Home;
